import React from 'react';
import Image1 from '.';
import Image2 from './row1/Project04.png';
import Image3 from './row1';
import Image4 from './row1';
import Image5 from './row1';

function firstImage(props) {
    return (
        <div className="first-row-image">
            <div className="scrach-image">
            <img class="image" src={Image1} alt="first-image" />
            </div>
            <div className="scratch-image">
            <img class="image" src={Image2} alt="second-image" />
            </div>
        </div>


    );
}

export default firstImage;
